import React, {useState} from 'react';
import './CSS/TelaStyle.css';
import './CSS/birthday.css'
/*import MenuItem from '@mui/material/MenuItem';
import FormHelperText from '@mui/material/FormHelperText';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';
import calculaIdade from './JS/calculaIdade';*/


function Birthday() {
    const [dia, setDia] = useState("");
    const [mes, setMes] = useState("");
    const [ano, setAno] = useState("");
    return (
        <div>
            <h3 className="pbirth">Birthday *</h3>
            <label className="text" for="dia">Day</label>
            <input
                id="dia"
                min="01" max="31"
                type="number"
                pattern="[0-9]{2}"
                placeholder="01"
                className="inputBday"
                required
                value={dia}
                onChange={(event) => {
                    setDia(event.target.value);
                }}
            />
            <label for="mes" className="text">Month</label>
            <input
                id="mes"
                min="01" max="12"
                type="number"
                pattern="[0-9]{2}"
                placeholder="01"
                className="inputBday"
                required
                value={mes}
                onChange={(event) => {
                    setMes(event.target.value);
                }}
            />
            <label for="ano" className="text">Year</label>
            <input
                id="ano"
                min="1800" max="2021"
                type="number"
                pattern="[0-9]{4}"
                placeholder="1800"
                className="inputBday"
                required
                value={ano}
                onChange={(event) => {
                    setAno(event.target.value);
                }}
            />
        </div>
    );
}

export default Birthday;


